import React, { Component } from "react";
import "../App.css";
class Login extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div className="login">
          <button onClick={this.props.handleLogin}>log in</button>
        </div>
      </React.Fragment>
    );
  }
}

export default Login;
